import React from 'react';
import styles from './Card.module.css'; // Import the CSS module

const Card = ({ card }) => {
    // Assuming 'card' has properties you want to display. Adjust as needed.
    return (
        <div className={styles.cardContainer}>
            {/* Card content, e.g., card ID, name, image, etc. */}
            <p>{card.id}</p>
            <p>{card.name}</p>
            {/* Add other card properties as needed */}
        </div>
    );
};

export default Card;
